            <img src={infoImg} alt={"..."} className="left img" />
            <div>
                <h3 className="card-title m-2 left">Card title</h3>
                <p className="card-text left">Some quick example text to build on the card title and make up the bulk of the card's content.</p>
                {/* <a href="#" class="btn btn-danger">Go somewhere</a> */}
            </div>
        </div>
    )
}

